import React from "react";
import Image from "./Image.jsx";

function Card(props) {

  console.log(props.imgURL);

  return (
    <div className="card">
      <div className="top">
        <h2 className="name">{props.name}</h2>
        <Image img={props.img}/>
      </div>
      <div className="bottom">
        <p className="info">{props.tel}</p>
        <p className="info">{props.email}</p>
      </div>
    </div>
  );
}

export default Card;
